">February 27, 2018</div>\n                    \n  CIFO announces a new exhibition space for Latin American art, Tania Bruguera is commissioned to create the 2018 installation in the Tate Turbine Hall, and Ana Mendieta comes to Berlin. Carlos Garaicoa opens in S&atilde;o Paulo, and Sandra Ramos opens in Miami.\n                </section>\n\n\n        <footer>\n\n        <div class=\"social-wrapper-news clearfix\">\n\n            <a href=\"/news/update-new-cisneros-fontanals-space-in-madrid-bruguera-tate-turbine-commiss/6711\" class=\"read-more-link\">» Read More</a>\n\n        <div class=\"social-icons\">\n        <span class=\"facebook\" data-url=\"http://www.cubanartnews.org/news/update-new-cisneros-fontanals-space-in-madrid-bruguera-tate-turbine-commiss/6711\">\n        <a href=\"http://www.facebook.com/sharer.php?s=100&amp;p[url]=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fupdate-new-cisneros-fontanals-space-in-madrid-bruguera-tate-turbine-commiss%2F6711&amp;p[title]=Update%3A+New+Cisneros-Fontanals+Space+in+Madrid%2C+Bruguera+Tate+Turbine+Commission+%26amp%3B+More&amp;p[summary]=%0A%09CIFO+announces+a+new+exhibition+space+for+Latin+American+art%2C+Tania+Bruguera+is+commissioned+to+create+the+2018+installation+in+the+Tate+Turbine+Hall%2C+and+Ana+Mendieta+comes+to+Berlin.+Carlos+Garaicoa+opens+in+S%26atilde%3Bo+Paulo%2C+and+Sandra+Ramos+opens+in+Miami.&amp;p[images][0]=http://www.cubanartnews.org/artwork/EF-CMinister-El_Mundo.jpg\" class=\"attachment- wp-post-image\" target=\"_blank\">\n        <img src=\"/images/social-thumb-facebook.png\" /></a></span>\n        \n\n        <span class=\"twitter tweet\" data-url=\"http://www.cubanartnews.org/news/update-new-cisneros-fontanals-space-in-madrid-bruguera-tate-turbine-commiss/6711\">\n        <a href=\"https://twitter.com/share?url=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fupdate-new-cisneros-fontanals-space-in-madrid-bruguera-tate-turbine-commiss%2F6711&via=CubanArtNews&text=%0A%09CIFO+announces+a+new+exhibition+space+for+Latin+American+art%2C+Tania+Bruguera+is+commissioned+to+create+the+2018+installation+in+the+Tate+Turbine+Hall%2C+and+Ana+Mendieta+comes+to+Berlin.+Carlos+Garaicoa+opens+in+S%26atilde%3Bo+Paulo%2C+and+Sandra+Ramos+opens+in+Miami.\" target=\"_blank\" >\n        <img src=\"/images/social-thumb-twitter.png\" /></a>\n        </span>\n        \n\n\n        </div>\n\n        </div>\n\n\n                </footer>\n\n    </div>\n\n</div>\n\n\n</div>\n\n\n\n\n\n\n\n\n \n  \n  \n  \n \n\n\n\n<div class=\"article-wrapper-secondary clearfix\">\n\n\n<div class=\"clearfix\">\n\n            \n        <div class=\"artwork\">\n        <a href=\"http://www.cubanartnews.org/news/art-market-update-cuban-art-goes-international-at-phillips/6698\"><img src=\"http://www.cubanartnews.org/artwork/BA-MyVernicle---1998.jpg\" class=\"\" /></a>\n        </div>\n        \n    \n\n    \n\n\n    <div class=\"article-content clearfix\">\n\n        <header>\n        <h2><a href=\"http://www.cubanartnews.org/news/art-market-update-cuban-art-goes-international-at-phillips/6698\">\n  Art Market Update: Cuban Art Goes International at Phillips</a></h2>\n        </header>\n\n\n        <section>\n        <div class=\"entry_date\">February 21, 2018</div>\n                    \n  With next week&rsquo;s &ldquo;New Now&rdquo; sale of contemporary art, Phillips makes good on its plan to integrate Latin American art into its international sales&mdash;including a special section on Cuban art.\n                </section>\n\n\n        <footer>\n\n        <div class=\"social-wrapper-news clearfix\">\n\n            <a href=\"/news/art-market-update-cuban-art-goes-international-at-phillips/6698\" class=\"read-more-link\">» Read More</a>\n\n        <div class=\"social-icons\">\n        <span class=\"facebook\" data-url=\"http://www.cubanartnews.org/news/art-market-update-cuban-art-goes-international-at-phillips/6698\">\n        <a href=\"http://www.facebook.com/sharer.php?s=100&amp;p[url]=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fart-market-update-cuban-art-goes-international-at-phillips%2F6698&amp;p[title]=Art+Market+Update%3A+Cuban+Art+Goes+International+at+Phillips&amp;p[summary]=%0A%09With+next+week%26rsquo%3Bs+%26ldquo%3BNew+Now%26rdquo%3B+sale+of+contemporary+art%2C+Phillips+makes+good+on+its+plan+to+integrate+Latin+American+art+into+its+international+sales%26mdash%3Bincluding+a+special+section+on+Cuban+art.&amp;p[images][0]=http://www.cubanartnews.org/artwork/BA-MyVernicle---1998.jpg\" class=\"attachment- wp-post-image\" target=\"_blank\">\n        <img src=\"/images/social-thumb-facebook.png\" /></a></span>\n        \n\n        <span class=\"twitter tweet\" data-url=\"http://www.cubanartnews.org/news/art-market-update-cuban-art-goes-international-at-phillips/6698\">\n        <a href=\"https://twitter.com/share?url=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fart-market-update-cuban-art-goes-international-at-phillips%2F6698&via=CubanArtNews&text=%0A%09With+next+week%26rsquo%3Bs+%26ldquo%3BNew+Now%26rdquo%3B+sale+of+contemporary+art%2C+Phillips+makes+good+on+its+plan+to+integrate+Latin+American+art+into+its+international+sales%26mdash%3Bincluding+a+special+section+on+Cuban+art.\" target=\"_blank\" >\n        <img src=\"/images/social-thumb-twitter.png\" /></a>\n        </span>\n        \n\n\n        </div>\n\n        </div>\n\n\n                </footer>\n\n    </div>\n\n</div>\n\n\n</div>\n\n\n\n\n\n\n\n\n \n  \n  \n  \n \n\n\n\n<div class=\"article-wrapper-secondary clearfix\">\n\n\n<div class=\"clearfix\">\n\n            \n        <div class=\"artwork\">\n        <a href=\"http://www.cubanartnews.org/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\"><img src=\"http://www.cubanartnews.org/artwork/ELL_3812.jpg\" class=\"\" /></a>\n        </div>\n        \n    \n\n    \n\n\n    <div class=\"article-content clearfix\">\n\n        <header>\n        <h2><a href=\"http://www.cubanartnews.org/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\">\n  Exclusive: Ella Fontanals-Cisneros on CIFO Art Space Closing &amp; Future Plans</a></h2>\n        </header>\n\n\n        <section>\n        <div class=\"entry_date\">February 13, 2018</div>\n                    \n  In a phone conversation from Madrid, CIFO founder Ella Fontanals-Cisneros spoke with <em>Cuban Art News</em> about CIFO in Miami, Cuban art and artists, her own collecting, and CIFO&rsquo;s plans going forward.\n                </section>\n\n\n        <footer>\n\n        <div class=\"social-wrapper-news clearfix\">\n\n            <a href=\"/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\" class=\"read-more-link\">» Read More</a>\n\n        <div class=\"social-icons\">\n        <span class=\"facebook\" data-url=\"http://www.cubanartnews.org/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\">\n        <a href=\"http://www.facebook.com/sharer.php?s=100&amp;p[url]=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fexclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans%2F6684&amp;p[title]=Exclusive%3A+Ella+Fontanals-Cisneros+on+CIFO+Art+Space+Closing+%26amp%3B+Future+Plans&amp;p[summary]=%0A%09In+a+phone+conversation+from+Madrid%2C+CIFO+founder+Ella+Fontanals-Cisneros+spoke+with+Cuban+Art+News+about+CIFO+in+Miami%2C+Cuban+art+and+artists%2C+her+own+collecting%2C+and+CIFO%26rsquo%3Bs+plans+going+forward.&amp;p[images][0]=http://www.cubanartnews.org/artwork/ELL_3812.jpg\" class=\"attachment- wp-post-image\" target=\"_blank\">\n        <img src=\"/images/social-thumb-facebook.png\" /></a></span>\n        \n\n        <span class=\"twitter tweet\" data-url=\"http://www.cubanartnews.org/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\">\n        <a href=\"https://twitter.com/share?url=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fexclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans%2F6684&via=CubanArtNews&text=%0A%09In+a+phone+conversation+from+Madrid%2C+CIFO+founder+Ella+Fontanals-Cisneros+spoke+with+Cuban+Art+News+about+CIFO+in+Miami%2C+Cuban+art+and+artists%2C+her+own+collecting%2C+and+CIFO%26rsquo%3Bs+plans+going+forward.\" target=\"_blank\" >\n        <img src=\"/images/social-thumb-twitter.png\" /></a>\n        </span>\n        \n\n\n        </div>\n\n        </div>\n\n\n                </footer>\n\n    </div>\n\n</div>\n\n\n</div>\n\n\n\n\n\n\n\n\n \n  \n  \n  \n \n\n\n\n<div class=\"article-wrapper-secondary clearfix\">\n\n\n<div class=\"clearfix\">\n\n            \n        <div class=\"artwork\">\n        <a href=\"http://www.cubanartnews.org/news/cuban-art-6-shows-to-see-now/6669\"><img src=\"http://www.cubanartnews.org/artwork/DonisLlago-Kremlin.jpg\" class=\"\" /></a>\n        </div>\n        \n    \n\n    \n\n\n    <div class=\"article-content clearfix\">\n\n        <header>\n        <h2><a href=\"http://www.cubanartnews.org/news/cuban-art-6-shows-to-see-now/6669\">\n  Cuban Art &ndash; 6 Shows to See Now</a></h2>\n        </header>\n\n\n        <section>\n        <div class=\"entry_date\">February 08, 2018</div>\n                    \n  The Kremlin faces off against the White House, the lines form at MoMA, and a historical center of US slavery contemplates Afro-Cuban history. A master printmaker&rsquo;s retrospective arrives in the US heartland, and a conceptual photographer journeys deeper into assemblage.\n                </section>\n\n\n        <footer>\n\n        <div class=\"social-wrapper-news clearfix\">\n\n            <a href=\"/news/cuban-art-6-shows-to-see-now/6669\" class=\"read-more-link\">» Read More</a>\n\n        <div class=\"social-icons\">\n        <span class=\"facebook\" data-url=\"http://www.cubanartnews.org/news/cuban-art-6-shows-to-see-now/6669\">\n        <a href=\"http://www.facebook.com/sharer.php?s=100&amp;p[url]=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fcuban-art-6-shows-to-see-now%2F6669&amp;p[title]=Cuban+Art+%E2%80%93+6+Shows+to+See+Now&amp;p[summary]=%0A%09The+Kremlin+faces+off+against+the+White+House%2C+the+lines+form+at+MoMA%2C+and+a+historical+center+of+US+slavery+contemplates+Afro-Cuban+history.+A+master+printmaker%26rsquo%3Bs+retrospective+arrives+in+the+US+heartland%2C+and+a+conceptual+photographer+journeys+deeper+into+assemblage.&amp;p[images][0]=http://www.cubanartnews.org/artwork/DonisLlago-Kremlin.jpg\" class=\"attachment- wp-post-image\" target=\"_blank\">\n        <img src=\"/images/social-thumb-facebook.png\" /></a></span>\n        \n\n        <span class=\"twitter tweet\" data-url=\"http://www.cubanartnews.org/news/cuban-art-6-shows-to-see-now/6669\">\n        <a href=\"https://twitter.com/share?url=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Fcuban-art-6-shows-to-see-now%2F6669&via=CubanArtNews&text=%0A%09The+Kremlin+faces+off+against+the+White+House%2C+the+lines+form+at+MoMA%2C+and+a+historical+center+of+US+slavery+contemplates+Afro-Cuban+history.+A+master+printmaker%26rsquo%3Bs+retrospective+arrives+in+the+US+heartland%2C+and+a+conceptual+photographer+journeys+deeper+into+assemblage.\" target=\"_blank\" >\n        <img src=\"/images/social-thumb-twitter.png\" /></a>\n        </span>\n        \n\n\n        </div>\n\n        </div>\n\n\n                </footer>\n\n    </div>\n\n</div>\n\n\n</div>\n\n\n\n\n\n\n\n\n \n  \n  \n  \n \n\n\n\n<div class=\"article-wrapper-secondary clearfix\">\n\n\n<div class=\"clearfix\">\n\n            \n        <div class=\"artwork\">\n        <a href=\"http://www.cubanartnews.org/news/tania-bruguera-on-untitled-havana-2000/6655\"><img src=\"http://www.cubanartnews.org/artwork/Tania_Bruguera_Untitled_2000-MoMA.jpg\" class=\"\" /></a>\n        </div>\n        \n    \n\n    \n\n\n    <div class=\"article-content clearfix\">\n\n        <header>\n        <h2><a href=\"http://www.cubanartnews.org/news/tania-bruguera-on-untitled-havana-2000/6655\">\n  Tania Bruguera on Untitled (Havana, 2000)</a></h2>\n        </header>\n\n\n        <section>\n        <div class=\"entry_date\">February 06, 2018</div>\n                    \n  This past Saturday, February 3, the Museum of Modern Art opened <em>Tania Bruguera: Untitled (Havana, 2000)</em>. At a media event last week, a conversation between the artist and two MoMA curators offered insights into the piece,<strong> </strong>its presentation at MoMA, and the process of bringing a radical work of performance art into a major museum collection.\n                </section>\n\n\n        <footer>\n\n        <div class=\"social-wrapper-news clearfix\">\n\n            <a href=\"/news/tania-bruguera-on-untitled-havana-2000/6655\" class=\"read-more-link\">» Read More</a>\n\n        <div class=\"social-icons\">\n        <span class=\"facebook\" data-url=\"http://www.cubanartnews.org/news/tania-bruguera-on-untitled-havana-2000/6655\">\n        <a href=\"http://www.facebook.com/sharer.php?s=100&amp;p[url]=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Ftania-bruguera-on-untitled-havana-2000%2F6655&amp;p[title]=Tania+Bruguera+on+%26%238220%3BUntitled+%28Havana%2C+2000%29%26%238221%3B&amp;p[summary]=%0A%09This+past+Saturday%2C+February+3%2C+the+Museum+of+Modern+Art+opened+Tania+Bruguera%3A+Untitled+%28Havana%2C+2000%29.+At+a+media+event+last+week%2C+a+conversation+between+the+artist+and+two+MoMA+curators+offered+insights+into+the+piece%2C+its+presentation+at+MoMA%2C+and+the+process+of+bringing+a+radical+work+of+performance+art+into+a+major+museum+collection.&amp;p[images][0]=http://www.cubanartnews.org/artwork/Tania_Bruguera_Untitled_2000-MoMA.jpg\" class=\"attachment- wp-post-image\" target=\"_blank\">\n        <img src=\"/images/social-thumb-facebook.png\" /></a></span>\n        \n\n        <span class=\"twitter tweet\" data-url=\"http://www.cubanartnews.org/news/tania-bruguera-on-untitled-havana-2000/6655\">\n        <a href=\"https://twitter.com/share?url=http%3A%2F%2Fwww.cubanartnews.org%2Fnews%2Ftania-bruguera-on-untitled-havana-2000%2F6655&via=CubanArtNews&text=%