=\"/can/category/interviews\">Interviews</a></h3>\n\n\n  <div class=\"item-wrapper gradient clearfix\">\n    <div class=\"thumbnail100x100\">\n    \n    <a href=\"/news/5-artists-1-curator-on-climate-change-cuba-usa/6623\"><img src=\"/images/thumbnails/TN_Cocos-ClimateChange.jpg\" alt=\"<p>\n  5 Artists + 1 Curator on <em>Climate Change: Cuba / USA</em></p>\" /></a>\n    \n  </div>\n    <div class=\"aside-item\">\n  <div style=\"display: table-cell; vertical-align: middle; height: 67px;\">\n  <a href=\"/news/5-artists-1-curator-on-climate-change-cuba-usa/6623\">\n  5 Artists + 1 Curator on Climate Change: Cuba / USA</a>\n  </div>\n  </div>\n  </div>\n\n  <div class=\"item-wrapper gradient clearfix\">\n    <div class=\"thumbnail100x100\">\n    \n    <a href=\"/news/laboratory-incubator-source-cuban-drawing-graphic-design-of-the-1920s-and-3/6558\"><img src=\"/images/thumbnails/TN_Rafael_Blanco_La_Poblacion_Flotante_copy.jpg\" alt=\"<p>\n  Laboratory, Incubator, Source: Cuban Drawing &amp; Graphic Design of the 1920s and &lsquo;30s</p>\" /></a>\n    \n  </div>\n    <div class=\"aside-item\">\n  <div style=\"display: table-cell; vertical-align: middle; height: 67px;\">\n  <a href=\"/news/laboratory-incubator-source-cuban-drawing-graphic-design-of-the-1920s-and-3/6558\">\n  Laboratory, Incubator, Source: Cuban Drawing &amp; Graphic Design of the 1920s and &lsquo;30s</a>\n  </div>\n  </div>\n  </div>\n\n  <div class=\"item-wrapper gradient clearfix\">\n    <div class=\"thumbnail100x100\">\n    \n    <a href=\"/news/olga-viso-on-adios-utopia-us-cuba-relations-and-the-changing-role-of-museum/6475\"><img src=\"/images/thumbnails/TN_OViso-Walker.jpg\" alt=\"<p>\n  Olga Viso on Adi&oacute;s Utopia, US-Cuba Relations, and the Changing Role of Museums</p>\" /></a>\n    \n  </div>\n    <div class=\"aside-item\">\n  <div style=\"display: table-cell; vertical-align: middle; height: 67px;\">\n  <a href=\"/news/olga-viso-on-adios-utopia-us-cuba-relations-and-the-changing-role-of-museum/6475\">\n  Olga Viso on Adi&oacute;s Utopia, US-Cuba Relations, and the Changing Role of Museums</a>\n  </div>\n  </div>\n  </div>\n\n</div>\n\n\n\n\n\n\n<div class=\"aside-bundle\">\n  \n  <h3><a href=\"/can/category/features\">Features</a></h3>\n\n\n  <div class=\"item-wrapper gradient clearfix\">\n  <div class=\"aside-item clearfix\">\n  <div class=\"thumbnail40x40\">\n          \n      <a href=\"/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\"><img src=\"/images/made/images/thumbnails/TN_ELL_3812_40_40_c1.jpg\" alt=\"\n  Exclusive: Ella Fontanals-Cisneros on CIFO Art Space Closing &amp; Future Plans\" /></a>\n      \n      </div>\n  <a href=\"/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\">\n  Exclusive: Ella Fontanals-Cisneros on CIFO Art Space Closing &amp; Future Plans</a>\n  </div>\n  </div>\n\n  <div class=\"item-wrapper gradient clearfix\">\n  <div class=\"aside-item clearfix\">\n  <div class=\"thumbnail40x40\">\n          \n      <a href=\"/news/tania-bruguera-on-untitled-havana-2000/6655\"><img src=\"/images/made/images/thumbnails/TN_Bruguera-Website_40_40_c1.jpg\" alt=\"\n  Tania Bruguera on Untitled (Havana, 2000)\" /></a>\n      \n      </div>\n  <a href=\"/news/tania-bruguera-on-untitled-havana-2000/6655\">\n  Tania Bruguera on Untitled (Havana, 2000)</a>\n  </div>\n  </div>\n\n  <div class=\"item-wrapper gradient clearfix\">\n  <div class=\"aside-item clearfix\">\n  <div class=\"thumbnail40x40\">\n          \n      <a href=\"/news/exploring-the-in-between-spaces-of-being-cuban/6654\"><img src=\"/images/made/images/thumbnails/TN_EnriqueGomezdeMolina-Venetian2018_40_40_c1.jpg\" alt=\"\n  Exploring the \"In-Between Spaces\" of Being Cuban\" /></a>\n      \n      </div>\n  <a href=\"/news/exploring-the-in-between-spaces-of-being-cuban/6654\">\n  Exploring the \"In-Between Spaces\" of Being Cuban</a>\n  </div>\n  </div>\n\n</div>\n\n\n\n\n\n\n\n<div class=\"aside-bundle\">\n<h3><a href=\"/headlines\">Headlines</a></h3>\n\n  <div class=\"item-wrapper gradientlight clearfix\">\n  <div class=\"aside-item\">\n  <a href=\"/news/update-new-cisneros-fontanals-space-in-madrid-bruguera-tate-turbine-commiss/6711\">\n  Update: New Cisneros-Fontanals Space in Madrid, Bruguera Tate Turbine Commission &amp; More</a>\n  <p>\n  CIFO announces a new exhibition space for Latin American art, Tania Bruguera is commissioned to create the 2018 installation in the Tate Turbine Hall, and Ana Mendieta comes to Berlin. Carlos Garaicoa opens in S&atilde;o Paulo, and Sandra Ramos opens in Miami.</p>\n  </div>\n  </div>\n\n  <div class=\"item-wrapper gradientlight clearfix\">\n  <div class=\"aside-item\">\n  <a href=\"/news/art-market-update-cuban-art-goes-international-at-phillips/6698\">\n  Art Market Update: Cuban Art Goes International at Phillips</a>\n  <p>\n  With next week&rsquo;s &ldquo;New Now&rdquo; sale of contemporary art, Phillips makes good on its plan to integrate Latin American art into its international sales&mdash;including a special section on Cuban art.</p>\n  </div>\n  </div>\n\n  <div class=\"item-wrapper gradientlight clearfix\">\n  <div class=\"aside-item\">\n  <a href=\"/news/exclusive-ella-fontanals-cisneros-on-cifo-art-space-closing-future-plans/6684\">\n  Exclusive: Ella Fontanals-Cisneros on CIFO Art Space Closing &amp; Future Plans</a>\n  <p>\n  In a phone conversation from Madrid, CIFO founder Ella Fontanals-Cisneros spoke with <em>Cuban Art News</em> about CIFO in Miami, Cuban art and artists, her own collecting, and CIFO&rsquo;s plans going forward.</p>\n  </div>\n  </div>\n\n</div>\n\n\n</aside>\n\n\n\n</div> <!-- #main -->\n</div> <!-- #main-container -->\n\n\n\n<div class=\"footer-container\">\n<footer class=\"wrapper clearfix\">\n\n\n<div class=\"left-column\">\n  <img src=\"/images/footer-cuban-art-news.png\" alt=\"Cuban Art News\" class=\"footer-logo\" />\n  <div class=\"copyright\">&copy; 2018 The Howard and Patricia Farber Fou